import React from 'react';
import classes from './PlaylistRow.module.css';

export default function PlaylistRow(props) {
  const yourArtists = props.playlist?.map((item) => {
    return (
      <div key={item.id} className={classes.rowItem}>
        {props.artists && <img src={item.images[1].url} alt={item.name} />}
        {props.tracks && <img src={item.album.images[1].url} alt={item.name} />}
        <h3>{item.name}</h3>
      </div>
    );
  });

  return <div className={classes.rowItems}>{yourArtists}</div>;
}
